import "./footer.css";

function Footer() {
  return (
    <>
      <div className="Apps">
        <div className="header-divs">
          <footer className="footer">
            <div class="attribution">
              Coded by
              <a href="https://twitter.com/aminat_adenuga" target="_blank">
                Corazon|DEV
              </a>
              .
            </div>
          </footer>
        </div>
      </div>
    </>
  );
}
export default Footer;
